import React from "react";
import "./contactUsComponent.css";

function ContactUs() {
  return (
    <div className="contact-container">
      <h2 className="contact-header">Contact Us</h2>
      <p className="contact-info">Email: Nexbank.cdac@gmail.com</p>
      <p className="contact-info">Phone: +91 9354442255</p>
      <p className="contact-info">Phone: +91 1234567890</p>
    </div>
  );
}

export default ContactUs;
